HELPFRAME_GMTALK_ISSUE3 = "La mayoría de los problemas de JcJ se pueden resolver a través de la mecánica JcJ del juego. Los MJ no te podrán ayudar en muchas ocasiones. Existen excepciones, tales como cualquier comportamiento que esté incluido dentro de la política de abuso de World of Warcraft. Para las reglas especiales de actividad JcJ, visita:";
