HELPFRAME_REPORTISSUE_TEXT1 = "A diferencia de la herramienta \"Hablar con un MJ\", esta función permite a los jugadores avisar al Departamento de Maestros de Juego sobre problemas que ocurren en el juego. A veces los jugadores se encuentran algo en el juego que necesita atención o intervención, pero que no requiere la respuesta de un MJ. Animamos a los jugadores a que en esos casos usen este canal de comunicación.";
