HELPFRAME_STUCK_TEXT1 = "Si te quedas atascado y no te puedes mover, utiliza la herramienta de desbloqueo automático antes de recurrir a un MJ. Esto debería resolver el problema en la mayoría de los casos. La orden de desbloqueo automático primero intentará utilizar tu piedra de hogar para teletransportarte a tu posada. Si no fuese posible, intentará empujar a tu personaje fuera de esa posición.\n\nEsta opción solo se puede utilizar cada 5 minutos. La opción de desbloqueo automático creará un registro con tu personaje y su ubicación para que podamos comprobarlo y corregirlo para la próxima vez.";
